The invention provides a photographic element comprising a support bearing a blue-light sensitive silver halide emulsion layer containing an acylacetanilide yellow image dye-forming coupler having formula I or II:


 wherein: 
   R a  is a substituted or unsubstituted alkyl, alkoxy, or aryloxy group; 
   R b  is a substituted or unsubstituted alkyl or aryl group; 
   R c  is hydrogen or a substituted or unsubstituted alkyl group; 
   R₁ is a substituent; 
   n is an integer from 0 to 2; 
   R₂ is selected from the group consisting of halogen, trifluoromethyl, and substituted or unsubstituted alkoxy and aryloxy; 
   R₃ is a substituted or unsubstituted alkyl group; 
   R₄ is hydrogen, halogen, alkoxy carbonyl (-CO₂R), carbamoyl (-CONRR'), carbonamido (-NRCOR'), sulfonamido (-NRSO₂R') or trifluoromethyl;R₁ is a substituent; 
   X is hydrogen or a coupling-off group; 
wherein said blue-light sensitive silver halide emulsion layer is a low-chloride silver halide emulsion. The invention enables improved image quality through increased interimage effects.

The present invention provides a photographic element comprising a support bearing a blue light sensitive silver halide emulsion layer containing an acylacetanilide yellow image dye-forming coupler having formula I:

 wherein: 
   R a  is a substituted or unsubstituted alkyl, alkoxy, or aryloxy group; 
   R b  is a substituted or unsubstituted alkyl or aryl group; 
   R c  is hydrogen or a substituted or unsubstituted alkyl group; 
   R₁ is a substituent; 
   R₂ is selected from the group consisting of halogen, trifluoromethyl, and substituted or unsubstituted alkoxy and aryloxy; 
   each R₃ is bonded at the 4- or 5- position relative to the anilino nitrogen and is independently a substituent selected from the group consisting of halogen, alkoxycarbonyl (-CO₂R), carbamoyl (-CONRR'), sulfonate (-OSO₂R), sulfamoyl (-SO₂NRR'), sulfonyl (-SO₂R), trifluoromethyl, cyano, and sulfonamido (-NRSO₂R'), in which each R and R' is independently hydrogen or a substituent; 
   q is 1 or 2; 
   R₄ and R₅ are independently hydrogen or an alkyl group; and 
   R₆ is a substituent; 
   n is an integer from 0 to (3-q); 
wherein the blue light sensitive silver halide emulsion layer has associated therewith a development inhibitor releasing coupler. The invention also provides a method of forming an image in such an element.

